import React, { Component } from "react";

class App extends Component {
  render() {
    return (
      <div className="catch-of-the-da">
        <h1>This is my App Component</h1>
        <div className="menu">
          <Header />
        </div>
        <Inventory />
        <Order />
      </div>
    );
  }
}
export default App;
